import React from "react";

import "./preloader.css";

function Preloader2() {
  function remove() {
    document.getElementById("pre").style.display = "none";
  }

  setTimeout(remove, 2000);

  document.title = "test";

  return (
    <div>
      <div id="pre" className="pre">
        <div class="container-preloader">
          <i class="layer"></i>
          <i class="layer"></i>
          <i class="layer"></i>
